import React from "react";
import { Card, CardContent } from "./ui/Card";

export function AlertsPanel() {
  return (
    <Card>
      <CardContent className="p-4">
        <h2 className="font-semibold text-lg mb-2">Alerts</h2>
        <ul className="space-y-2">
          <li className="text-red-400">BIN 103 - FULL!</li>
          <li className="text-yellow-400">BIN 207 - 85% Approaching Limit</li>
          <li className="text-blue-400">BIN 191 - Sensor Error</li>
        </ul>
      </CardContent>
    </Card>
  );
}
